import React, { Component } from 'react'
import './Home.css'


export default class Home extends Component {

    handleLogout() {

        localStorage.clear()
    }

    render() {

        if(this.props.email){
            return (
                <div className="home">

                <select>
                    <option></option>
                </select>

                <p> Welcome {this.props.email} </p>
                <p>จองที่พัก</p>
                <p>แก้ไขข้อมูล</p>
                <button onClick={this.handleLogout} >Logout</button>

                </div>
            )
        }

        return (
                <div>

                </div>
            )
    }
}
